        private readonly Table<Job> jobTable;

        /// <summary>
        /// The job status table
        /// </summary>
        private readonly Table<JobStatus> jobStatusTable;

        /// <summary>
        /// The job study id table
        /// </summary>
        private readonly Table<JobResults> jobResultsTable;

        /// <summary>
        /// The job student id table
        /// </summary>
        private readonly Table<JobResults_Outcomes> jobResultsOutcomesTable;

        /// <summary>
        /// The job student id table
        /// </summary>
        private readonly Table<Analysis> analysisTable;


        /// <summary>
        /// Initializes a new instance of the <see cref="SqlJobResultsRepository"/> class.
        /// </summary>
        /// <param name="connectionString">
        /// The connection string.
        /// </param>
        public SqlJobResultsRepository(string connectionString)
        {
            DataContext dc = new DataContext(connectionString);
            this.jobTable = dc.GetTable<Job>();
            this.jobStatusTable = dc.GetTable<JobStatus>();
            this.jobResultsTable = dc.GetTable<JobResults>();
            this.jobResultsOutcomesTable = dc.GetTable<JobResults_Outcomes>();
            this.analysisTable = dc.GetTable<Analysis>();
        }

