        /// </summary>
        /// <param name="jobGUID">The job GUID.</param>
        /// <returns>The job reslts by jobGUID</returns>
        public JobResults GetJobResultByJobGUID(Guid jobGUID)
        {
            var outcomes = (from s in this.jobResultsTable
                            where s.JobGUID == jobGUID
                            select s);

            if (outcomes.Count() == 0)
                return null;
            else
                return outcomes.First();
        }

        /// <summary>
        /// The get job results by user ID
        /// </summary>
        /// <param name="jobGUID">The user ID.</param>
        /// <returns>The job reslts by user ID</returns>
        public IEnumerable<Job> GetJobResultByUserId(List<Analysis> things)
        {
            var jobs = new List<Job>();

            foreach (Analysis analysis in things)
            {
                Job job = (from s in this.jobTable
                 where s.JobGUID == analysis.JobGUID
                 select s).First();

                jobs.Add(job);
            }

            if (jobs.Count() == 0)
                return null;
            else
                return jobs;
        }

