        /// <summary>
        /// Returns status name
        /// </summary>
        /// <param name="id">The id of the job status.</param>
        /// <returns>System.String.</returns>
        public string GetJobStatusNameById(int id)
        {
            var status = this.jobStatusTable.FirstOrDefault(x => x.Id == id);
            if (status == null)
            {
                return string.Empty;
            }

            return status.Name;
        }

        /// <summary>
        /// The update notes by job GUID
        /// </summary>
        /// <param name="jobGUID">The job GUID.</param>
        /// <param name="rank">rank order of outcome</param>
        /// <param name="type">The type.</param>
        /// <returns>System.String.</returns>
        public string GetChartByJobGUIDAndRank(Guid jobGUID, int rank, string type = "ss")
        {
            var outcome = (from s in this.jobResultsOutcomesTable
                           where s.JobGUID == jobGUID && s.Rank == rank
                           select s).Single();
            if (type.ToLower() == "ss")
            {
                return outcome.Chart_ScaleScore;
            }
            else
            {
                return outcome.Chart_PercentProficient;
            }
        }

        /// <summary>
        /// Get the balance chart for a job.
        /// </summary>
        /// <param name="jobGUID">The job GUID.</param>
        /// <returns>System.String.</returns>
        public string GetBalanceChartByJobGUID(Guid jobGUID, bool second)
        {
            var outcome = (from s in this.jobResultsTable
                           where s.JobGUID == jobGUID
                           select s).Single();

            if (second)
            {
                return outcome.BalancePlotSensitivity;
            }
            else
            {
                return outcome.Image;
            }
        }

        /// <summary>
        /// The get jobs by userName
        /// </summary>
        /// <param name="userName">
        /// The user name.
        /// </param>
        /// <returns>
        /// List of jobs by userName
        /// </returns>
        public List<Job> GetJobsByAnalyses(List<Analysis> analyses)
        {
            var jobs = (from j in this.jobTable
                            where analyses.Select(c => c.JobGUID).Contains(j.JobGUID)
                            orderby j.CreatedOn descending
                            select j).ToList();
            return jobs;
        }

        /// <summary>
        /// The get jobs by userName
        /// </summary>
        /// <param name="guids">The guids.</param>
        /// <param name="status">The status.</param>
        /// <returns>List of jobs by userName</returns>
        public List<Guid> GetJobGUIDsByJobGUIDsAndStatus(List<Guid> guids, int status)
        {
            var jobs = (from j in this.jobTable
                        where guids.Contains(j.JobGUID) && j.StatusId == status
                        select j.JobGUID).ToList();
            return jobs;
        }

